import { ContextMenu } from "./ContextMenu"
import { save } from "./save"

export const UI = () => {
  const inputStyle = {
    border: 0,
    margin: "8px 16px"
  }

  return <>
    <div
      style={{
        display: "absolute",
        zIndex: 1,
        display: "flex",
        flexDirection: "row"
        }}
      >
      <input
        type="button"
        value="Save"
        style={inputStyle}
        onClick={save}
      />
    </div>
    <ContextMenu
      first={true}
    />
  </>
}
